function initMap() {
    // Set the center to a specific location (e.g., New York City)
    const center = { lat: 42.963196, lng: -85.887877 };

    map = new google.maps.Map(document.getElementById("map"), {
        center: center,
        zoom: 16, // Adjust the zoom level as needed
        mapTypeId: 'satellite', // Set the map type to satellite
        streetViewControl: false, // Hide the street view control
        mapTypeControl: false, // Hide the map type control
        rotateControl: false, // Hide the rotate control button
        mapTypeControlOptions: {
            style: google.maps.MapTypeControlStyle.DROPDOWN_MENU,
            mapTypeIds: ['satellite', 'roadmap'],
        },
    });
    map.setTilt(0)
}


