// Function to populate the dropdown with options
function populateDropdown() {
    // Populate starting location dropdown
    const startDropdown = document.getElementById('startLocationDropdown');
    populateOptions(startDropdown);

    // Populate ending location dropdown
    const endDropdown = document.getElementById('endLocationDropdown');
    populateOptions(endDropdown);
}

// Function to populate options in a dropdown
function populateOptions(dropdown) {
    // Add a default empty option
    const defaultOption = document.createElement('option');
    defaultOption.value = ''; // Empty value
    defaultOption.text = 'Select a location'; // Displayed text
    dropdown.appendChild(defaultOption);

    // Loop through the dictionary and add options to the dropdown
    for (const [location, code] of Object.entries(locations)) {
        const option = document.createElement('option');
        option.value = code;
        option.text = location;
        dropdown.appendChild(option);
    }
}

// Call the function to populate both dropdowns when the page loads
document.addEventListener('DOMContentLoaded', populateDropdown);

// Priority queue implementation for Dijkstra's algorithm
class PriorityQueue {
    constructor() {
      this.queue = [];
    }
  
    enqueue(element, priority) {
      this.queue.push({ element, priority });
      this.sortQueue();
    }
  
    dequeue() {
      return this.queue.shift().element;
    }
  
    isEmpty() {
      return this.queue.length === 0;
    }
  
    sortQueue() {
      this.queue.sort((a, b) => a.priority - b.priority);
    }
  }

