function turnIntoCoordinates(path){
    var coordinates = []

    for (let node of path) {
        let [x,y] = coord_dict[node]
        coordinates.push({lat : x, lng : y})
    }
    return coordinates
}

// Function to display a message below the button
function displayMessage(message) {
    var messageContainer = document.getElementById('messageContainer');
    messageContainer.innerHTML = '<p>' + message + '</p>';
}

// Update the function that gets called when the "Show Path on Google Maps" button is clicked
document.getElementById('showPathButton').addEventListener('click', function() {
    // Check if the polyline exists
    if (polyline) {
        // Create an array of LatLng objects from the coordinates
        var pathCoordinates = polyline.getPath().getArray();

        // Open the path on Google Maps
        window.open('https://www.google.com/maps/dir/' + pathCoordinates.map(coord => coord.lat() + ',' + coord.lng()).join('/'));
    } else {
        displayMessage('No route to show. Please calculate the route first.');
    }
});
